- input: "TEXT\x1CC00385690\x1C.TEXT\x1C\x1CF3XT\x1CThe Committee wishes to disclose
    the following:  1) No expenditures designated on Schedule B supporting Line 21(b)
    were made on behalf of any specifically identified federal candidate;  2) No expenditures
    disclosed on Schedule B, Line 21(b) constituted in-kind contributions or independent
    expenditures as defined under 11 CFR 100.26, 106.6(b)(2)(i), and 100.22; 3) The
    Committee requests address, employer, and occupation information from all contributors
    whose yearly aggregate contributions exceed $200.00 and informs them of the requirement
    of complying with 11 CFR 104.7(b)(1).  In the event that the information is not
    supplied as a result of the initial request, Committee makes a subsequent attempt
    to collect the information by mail, email, or telephone contact within 30 days
    of the initial contribution.  This 'follow up' request a) clearly asks for the
    missing information without requesting a contribution, b) informs the contributor
    of the requirements for reporting such information under federal law, and c) is
    enclosed with a pre-addressed envelope when sent by postal mail.  If the information
    is submitted after the initial monthly report is filed, the contributor master
    file is updated and the information is corrected in the next regularly filed report."
